import { xml2json } from "xml-js";

export abstract class AbstractMapperService {

    getNodeValue(node: any, tag: string): any {
        if (node.getElementsByTagName(tag)[0]) {
            return node.getElementsByTagName(tag)[0].innerHTML;
        }
        return "";
    }

    getStringToDate(strDate: string) {
        let dYear = strDate.substring(0, 4);
        let dMonth = strDate.substring(4, 6);
        let dDay = strDate.substring(6, 8);
        let strSplit = dYear + "-" + dMonth + "-" + dDay;
        let date = new Date(strSplit);
  
        console.log("Date: Origin " + strDate + " - " + date);
        console.log("Date: split " + strSplit);
        return strSplit;
     }
  
     convertirXmlEnObjeto(xml: string): any {
        const json = xml2json(xml);
        console.log("XML convertido ");
        console.log(json);
        return json;
     }
  
     getFingerImage() {
        return `<fingerImage>
        
        </fingerImage>`;
     }

}